            img:"https://th.bing.com/th/id/OIP.8NYDtbLqraAquonpU0qb8QHaFj?w=206&h=180&c=7&r=0&o=5&pid=1.7" 
        }}
       />
       <Ul_li 
        p={{
            id:"telegram    " ,
            text:"Telegram",
            for:"for-telegram",
            img:"https://th.bing.com/th/id/OIP.P6WL3XxOPGhdEko7yoGbbQHaFj?w=213&h=180&c=7&r=0&o=5&pid=1.7" 
        }}
       />
      {/* <Ul_li id="youtub" text="Youtub" for="for-Youtub" 
