      <Ul_li id="whatsapp" text="Whatsapp" for="for-whatsapp" img='https://th.bing.com/th/id/OIP.8NYDtbLqraAquonpU0qb8QHaFj?w=206&h=180&c=7&r=0&o=5&pid=1.7' /> */}

    </ul>
  );
}
export default List;
